Sie suchen ein kleines Geschenk zum Geburtstag, wollen jemanden eine Freude 
machen oder möchten etwas für sich selber? Dann sind Sie bei mir im Shop gerade richtig.</font></b></p><p align="center">
    <span style="font-weight: 700">
<font size="4" color="#00008B" face="Times New Roman">So oder so ähnlich könnten 
    Ihre Karten aussehen.</font></span><font size="4" color="#00008B"><b> Verschiedene 
Mustervorlagen zur freien Auswahl, siehe unten.</b></font></p><p align="center">
