<p align="left">
<font color="#00008B" face="Times New Roman">Sie werden 
auf erstklassigem </font>
<font color="#00008b" face="Arial, Helvetica, sans-serif">
                    <span style="font-family: Times New Roman; ">
                    F</span><span style="font-family: Times New Roman; " lang="EN-GB">oto </span>
