zu biegen, brechen nicht und gegen Verschmutzung geschützt (vergleichbar Personalausweis).</font><font size="4" color="#00008B" face="Times New Roman"> </font>
<font color="#00008B" face="Times New Roman">&nbsp;</font><font color="#00008b" face="Arial, Helvetica, sans-serif"><span style="font-family:Times New Roman; color:#000099; ">Der Druck erfolgt</span><span style="font-family: Times New Roman; color: #000099; " lang="EN-GB"> </span>
