<p align="left">
<font size="5" color="#000080"><span style="font-family: Times New Roman; font-weight: 700">
Eine 
große Auswahl an anderen Motiven finden Sie in meinem SHOP!</span></font></p>
<p align="left">
<font color="#000099">
<font face="Times New Roman">M</font><font id="role_document4" face="Times New Roman">ein 
Kontaktformular (</font><span style="font-family: Times New Roman; ">Druckdatenblatt) erhalten Sie nach dem Kauf per Mail zugesendet! </span>
                    <font id="role_document1" face="Times New Roman">
Hier können Sie mir alle Wünsche, ob </font>
<font face="Times New Roman">
Text, Schriftart, Schriftfarbe, Bild ( auch eigene Bilder</font><span style="font-weight: 400"><font face="Times New Roman">&nbsp;)</font></span><font id="role_document1" face="Times New Roman"> 
ect. mitteilen. </font><font face="Times New Roman">Wenn ich alle Daten von Ihnen habe mache ich 
Ihnen einen Entwurf fertig&nbsp; und sende Ihnen 
diese per  Mail zu. Erst wenn Sie zufrieden sind und mir die Druck Freigabe per 
Mail erteilen, erfolgt die Herstellung.</font></font></p>
<p align="left">
<font color="#000099" face="Times New Roman">Sie haben bereits eine Vorlage oder 
möchten ihr eigenes Foto, Loge ect. drauf haben?  </font><font color="#000099">
