von mind. 300 dpi</font></strong></span><font face="Times New Roman"> </font><span style="font-weight: 400">
<font face="Times New Roman">)</font></span><font face="Times New Roman">. </font></font>
<b><font color="#FF0000" face="Times New Roman">
