<p style="text-align: justify;"><span face="comic sans ms, sans-serif" style="font-family: ''comic sans ms'', sans-serif;">hochwertige Visitenkarten, für Kopierer, Laser- und Inkjetdrucker,<br>Maße: 85 x 55 mm (BxH)<br>Ausführung 3C:<br>Clean - ohne Perforation,<br>Cut - glatter Schnitt rundum,<br>Cards - hochwertiger, stabiler Edelkarton<br>abgerundete Ecken<br>Farbe: weiß<br>Grammatur: 225 g/qm</span></p>
<p style="text-align: justify;"><strong style="line-height: 1.5;"><span style="font-family: ''comic sans ms'', sans-serif;">Hersteller: &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><span style="font-family: ''comic sans ms'', sans-serif;"> SIGEL</span></p>
