<p style="text-align: justify;"><span style="color: #000000;"><strong><span style="font-family: ''comic sans ms'', sans-serif;">EAN: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></strong><span style="font-family: ''comic sans ms'', sans-serif;">4004360995033</span></span></p>
<p style="text-align: justify;"><span style="color: #000000;"><strong><span style="font-family: ''comic sans ms'', sans-serif;">Zustand: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style="font-family: ''comic sans ms'', sans-serif;"> Neu</span></strong></span></p>
<p style="text-align: justify;"><span style="color: #ff6600;"><strong><span style="font-family: ''comic sans ms'', sans-serif;"><span color="#008080">Beachten Sie bitte, dass Sortiments-Artikel in mehreren Ausf&uuml;hrungen erh&auml;ltlich sein k&ouml;nnen. Zumeist enthalten diese Artikel den Zusatz "sortiert" oder "Sortiment". Eine Varianten- bzw. Farb-Auswahl ist leider nicht m&ouml;glich. Es wird in den meisten F&auml;llen nur ein Artikel geliefert, auch wenn das Artikelbild mehrere Ausf&uuml;hrungen zeigt oder im Artikeltext von mehreren Ausf&uuml;hrungen die Rede ist. Bei einigen Sortimenten k&ouml;nnen die Farben der gelieferten Artikel zum Artikelbild abweichen. Die Angabe VE bedeutet "Verpackungseinheit", d.h. bei einer Angabe "VE5" werden z.B. 5 St&uuml;ck geliefert.</span></span></strong></span></p>
<p style="text-align: justify;"><span style="color: #000000;"><strong><span style="font-family: ''comic sans ms'', sans-serif;"><span color="#008080"><img src="http://klicky-paradies.plenty-test-drive.eu/images/produkte/i43/4349-151402307-1402307-0-0.jpg" alt="4349" title="4349" id="plenty_xl_image_4349_1" border="0" style="margin:2px; padding:2px" />, ,&nbsp;<strong><span><span color="#008080">&nbsp;,&nbsp;<strong><span><span color="#008080"></span></span></strong></span></span></strong></span></span></strong></span></p>
<address style="text-align: justify;"><span style="color: #000000;"><span style="font-family: ''comic sans ms'', sans-serif;"><span color="#008080"><span color="#008080"><span color="#008080"><span style="text-decoration: underline;">Hinweis zur Entsorgung von Altbatterien</span>&nbsp;<br /><span style="line-height: 1.5;">Batterien d&uuml;rfen nicht &uuml;ber den Hausm&uuml;ll entsorgt werden. Sie sind zur R&uuml;ckgabe von Altbatterien gesetzlich verpflichtet, damit eine fachgerechte Entsorgung gew&auml;hrleistet werden kann. Sie k&ouml;nnen Altbatterien an einer kommunalen Sammelstelle oder im Handel vor Ort abgeben. Auch wir sind als Vertreiber von Batterien zur R&uuml;cknahme von Altbatterien verpflichtet, wobei sich unsere R&uuml;cknahmeverpflichtung auf Altbatterien der Art beschr&auml;nkt, die wir als Neubatterien in unserem Sortiment f&uuml;hren oder gef&uuml;hrt haben. Altbatterien vorgenannter Art k&ouml;nnen Sie daher entweder ausreichend frankiert an uns zur&uuml;cksenden oder sie direkt bei uns unentgeltlich abgeben.</span><br /><span style="line-height: 1.5;">Batterien sind mit dem Symbol einer durchgekreuzten M&uuml;lltonne (s. u.) gekennzeichnet. Dieses Symbol weist darauf hin, dass Batterien nicht in den Hausm&uuml;ll gegeben werden d&uuml;rfen. Bei Batterien, die mehr als 0,0005 Masseprozent Quecksilber, mehr als 0,002 Masseprozent Cadmium oder mehr als 0,004 Masseprozent Blei enthalten, befindet sich unter dem M&uuml;lltonnen-Symbol die chemische Bezeichnung des jeweils eingesetzten Schadstoffes &ndash; dabei steht "Cd" f&uuml;r Cadmium, "Pb" steht f&uuml;r Blei, und "Hg" f&uuml;r Quecksilber.</span></span></span></span></span></span></address><address style="text-align: justify;"><span style="color: #000000;"><span style="font-family: ''comic sans ms'', sans-serif;"><span color="#008080"><span color="#008080"><span color="#008080"><span style="line-height: 1.5;"></span></span></span></span></span></span><img src="http://www.ad-tuning.de/templates/ad-schnellversand/apanado/gfx/batt.gif" alt="" border="0" style="line-height: 1.5;" /><span style="line-height: 1.5;">&nbsp;</span></address>

